import React, { Component } from 'react'
import './PokeCardsStyles.css'
const PokeUrl= 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/'

export default class PokeCards extends Component {
  render() {
    let ImageSrc = `${PokeUrl}${this.props.id}.png`;
    return (
        <div className='card'>
            <h1>{this.props.name}</h1>
            <img src={ImageSrc} alt='pngfile'/>
            <div>
                <div>Type: {this.props.type}</div>
                <div>Exp: {this.props.exp}</div>
            </div>

        </div>
    )
  }
}
